function textChunksToMorphs() {
    this.createWordChunks()
    if (this.textMorphs)
        this.textMorphs.invoke('remove')

    this.textMorphs = this.textChunks.collect(function(c) {
        var clientRect = c.chunkNode.getBoundingClientRect();
        var globalBounds = this.clientRectToGlobalBounds(clientRect)
        var localBounds = this.world().transformToMorph(this).
            transformRectToRect(globalBounds);
        m = new lively.morphic.Text(localBounds, c.textString)
        this.addMorph(m)
        // m.setOrigin(m.getPosition().subPt(this.getPosition()))
        // m.beLabel()
        m.disableEvents()
        m.setFill(null)
        m.applyStyle({fixedWidth: 0, borderColor: null})
        m.setFontSize(this.getFontSize())
        m.setPadding(new Rectangle(0,0,0,0))
        // m.applyStyle(c.style)
        m.isEpiMorph = true;
        return m
    }, this)
    // this.textMorphs.invoke('openInWorld')
    this.setTextColor(Color.white.withA(0))

}

