function animateText() {
    this.textMorphs.forEach(function(ea) {
      ea.setFontSize((ea.getFontSize() || 10) + Math.random() * 0.2)
      ea.setRotation(ea.getRotation() + (Math.random() - 0.1) * 0.06)
    })

    this.textMorphs[0].setFontSize(20)
}

